import React, { Component } from "react";

import { View, Text, Platform, TextInput, StyleSheet } from "react-native";

export default class CustomComponent extends Component {
  static propTypes = {
    FuelUp: JSON,
    PreviousFuelUp: JSON,
  };

  constructor(props) {
    super(props);
    // Don't call this.setState() here!
    this.state = { counter: 0 };
    if (props.PreviousFuelUp != undefined) {
      this.km = (
        props.FuelUp.mileage - props.PreviousFuelUp.mileage
      ).toString();
    } else {
      this.km = "";
    }
  }

  render() {
    return (
      <View style={styles.top}>
        <table>
          <tbody>
            <tr>
              <td>
                <Text style={styles.text}>{this.props.FuelUp.date}</Text>
              </td>
              <td>
                <Text style={styles.text}>
                  {this.props.FuelUp.price
                    .toString()
                    .replace(/\B(?=(\d{3})+(?!\d))/g, " ")}{" "}
                  Ft
                </Text>
              </td>
            </tr>
            <tr>
              <td>
                <Text style={styles.text}>
                  {this.props.FuelUp.mileage
                    .toString()
                    .replace(/\B(?=(\d{3})+(?!\d))/g, " ")}{" "}
                  km
                </Text>
              </td>
              <td>
                <Text style={styles.text}>{this.props.FuelUp.volume} l</Text>
              </td>
            </tr>
            <tr>
              <td>
                <Text style={styles.text}>{this.km} km</Text>
              </td>
              <td>
                <Text style={styles.text}>??? Ft/km</Text>
              </td>
            </tr>
            <tr>
              <td colSpan="2">
                <Text style={styles.text}>
                  {this.props.PreviousFuelUp == undefined
                    ? ""
                    : (
                        (this.props.FuelUp.volume * 100) /
                        (this.props.FuelUp.mileage -
                          this.props.PreviousFuelUp.mileage)
                      ).toFixed(2)}{" "}
                  l/100km
                </Text>
              </td>
            </tr>
          </tbody>
        </table>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#fff",
    alignItems: "center",
    // justifyContent: "top",
  },
  top: {
    backgroundColor: "#6c757d",
    borderRadius: 20,
    width: 1000,
    marginBottom: 10,
    padding: "10px",
  },
  text: {
    color: "#fff",
    fontSize: 25,
  },
});
